def makelabelentry(frame, array, title, startcol, widthlabel, widthentry):
    if(len(title)==0):
        title=array
    for i, content in enumerate(array):
        globals()['label_%s'%(content)] = Label(frame, text=title[i], width=widthlabel, anchor='e')
        globals()['label_%s'%(content)].grid(row=i+startcol, column=0, padx=5)
        globals()['entry_%s'%(content)] = Entry(frame, width=widthentry, justify='right')
        globals()['entry_%s'%(content)].grid(row=i+startcol, column=1)

def makelabelradio(frame, array, title, startcol, widthlabel, widthradio):
    if(len(title)==0):
        title=array
    for i, content in enumerate(array):
        globals()['label_%s'%(content)] = Label(frame, text=title[i], width=widthlabel, anchor='e')
        globals()['label_%s'%(content)].grid(row=i+startcol, column=0, padx=5)

        globals()['radiovar_%s'%(content)] = IntVar()
        globals()['radio_%s_1'%(content)] = Radiobutton(frame, text='On (1)', value=1, variable=globals()['radiovar_%s'%(content)])
        globals()['radio_%s_0'%(content)] = Radiobutton(frame, text='Off (0)', value=0, variable=globals()['radiovar_%s'%(content)])
        globals()['radio_%s_1'%(content)].grid(row=i+startcol, column=1)
        globals()['radio_%s_0'%(content)].grid(row=i+startcol, column=2)

def fillentry(entry, content):
    if(entry['state']=='readonly'):
        entry['state']='normal'
        entry.delete(0, "end")
        entry.insert(0, content)
        entry['state']='readonly'
    else:
        entry.delete(0, "end")
        entry.insert(0, content)


#THIS FUNCTION IS ONLY EXECUTED WHEN READING NEW FITS'
def initdisplay():
    print("[BAYGAUD] Generating moment maps...")
    global dummyframe_mom0, dummyframe_mom1, dummyframe_mom2

    dummyframe_mom0.destroy()   #REMOVE PRE EXISTING SCREEN
    dummyframe_mom1.destroy()
    dummyframe_mom2.destroy()

    dummyframe_mom0 = Frame(tab_mom0)
    dummyframe_mom1 = Frame(tab_mom1)
    dummyframe_mom2 = Frame(tab_mom2)

    dummyframe_mom0.pack()  #REPACK SCREENS
    dummyframe_mom1.pack()
    dummyframe_mom2.pack()

    with fits.open(params['cube'], 'update') as hdu:
        hdu = hdu[0]
        try:
            hdu.header['RESTFREQ'] = hdu.header['FREQ0']    #THIS IS NEEDED WHEN INPUTING FITS PROCESSED WITH GIPSY
        except:
            pass

        try:
            if(hdu.header['CUNIT3']=='M/S' or hdu.header['CUNIT3']=='m/S'):
                hdu.header['CUNIT3'] = 'm/s'
        except KeyError:
            hdu.header['CUNIT3'] = 'm/s'
        
    
    cube = SpectralCube.read(params['cube']).with_spectral_unit(u.km/u.s)

    global cubedata
    cubedata = fits.getdata(params['cube'])

    #PEAK SN CALCULATING PART
    rms = fits.getdata(params['cube'])[0,:,:]  #READ FIRST CHANNEL OF A CUBE, ASSUMING NO SOURCE THERE
    rms = np.sqrt(np.nanmean(np.square(rms)))
    peak = np.nanmax(cubedata, axis=0)
    peaksn = peak/rms 

    cdelt3 = abs(fits.getheader(params['cube'])['CDELT3'])
    ref_vf_data = fits.getdata(params['ref_vf'])

    global data_mom0, data_mom1, data_mom2
    data_mom0 = cube.moment(order=0).hdu.data   # MAKING MOMENT MAP USING SPECTRALCUBE, THIS DOES NOT TAKES PART IN RUNNING BAYGAUD, JUST FOR DISPLAYING
    data_mom1 = ref_vf_data
    data_mom2 = cube.moment(order=2).hdu.data
    data_mom2[data_mom2<0]=0
    data_mom2 = np.sqrt(data_mom2)
    data_mom2 = np.ma.masked_array(data_mom2, mask=peaksn<2)

    fig_mom0, ax_mom0 = plt.subplots(constrained_layout=True)
    fig_mom1, ax_mom1 = plt.subplots(constrained_layout=True)
    fig_mom2, ax_mom2 = plt.subplots(constrained_layout=True)

    fig_mom0.set_figwidth(500/fig_mom0.dpi)
    fig_mom1.set_figwidth(500/fig_mom1.dpi)
    fig_mom2.set_figwidth(500/fig_mom2.dpi)

    fig_mom0.set_figheight(500/fig_mom0.dpi)
    fig_mom1.set_figheight(500/fig_mom1.dpi)
    fig_mom2.set_figheight(500/fig_mom2.dpi)

    img_mom0 = ax_mom0.imshow(data_mom0, cmap='copper', clim=(np.nanmin(data_mom0),np.nanmax(data_mom0)), interpolation='none')
    img_mom1 = ax_mom1.imshow(data_mom1, cmap='jet', clim=np.nanpercentile(data_mom1, [10.0, 90.0]), interpolation='none')
    img_mom2 = ax_mom2.imshow(data_mom2, cmap='jet', clim=(0, 50), interpolation='none')

    params_display['mom0_min'] = img_mom0.get_clim()[0]
    params_display['mom0_max'] = img_mom0.get_clim()[1]
    params_display['mom1_min'] = img_mom1.get_clim()[0]
    params_display['mom1_max'] = img_mom1.get_clim()[1]
    params_display['mom2_min'] = img_mom2.get_clim()[0]
    params_display['mom2_max'] = img_mom2.get_clim()[1]

    button_settings_display['state'] = 'normal'

    # print(params_display)

    ax_mom0.invert_yaxis()
    ax_mom1.invert_yaxis()
    ax_mom2.invert_yaxis()

    global canvas_mom0
    canvas_mom0 = FigureCanvasTkAgg(fig_mom0, master=dummyframe_mom0)   #DRAWING FIGURES ON GUI FRAME
    canvas_mom0.draw()
    canvas_mom0.get_tk_widget().pack(side=TOP, fill=BOTH, expand=True)
    canvas_mom0.mpl_connect('button_press_event', onclick)  #CONNECTING MOUSE CLICK ACTION

    global canvas_mom1
    canvas_mom1 = FigureCanvasTkAgg(fig_mom1, master=dummyframe_mom1)
    canvas_mom1.draw()
    canvas_mom1.get_tk_widget().pack(side=TOP, fill=BOTH, expand=True)
    canvas_mom1.mpl_connect('button_press_event', onclick)

    global canvas_mom2
    canvas_mom2 = FigureCanvasTkAgg(fig_mom2, master=dummyframe_mom2)
    canvas_mom2.draw()
    canvas_mom2.get_tk_widget().pack(side=TOP, fill=BOTH, expand=True)
    canvas_mom2.mpl_connect('button_press_event', onclick)

    plt.close(fig_mom0)
    plt.close(fig_mom1)
    plt.close(fig_mom2)

    print("[BAYGAUD] Moment maps generated")

