def onclick(event):

    if(event.xdata==None or event.ydata==None): return
    x = int(event.xdata+0.5)
    y = int(event.ydata+0.5)
    #print(data_mom2[y,x], np.nanmedian(cubedata[:,y,x]), np.nanmean(cubedata[:,y,x]))
    toplevel_spectrum = Toplevel(root)
    toplevel_spectrum.bind('<Escape>', lambda x: toplevel_spectrum.withdraw())
    with fits.open(params['cube'], 'update') as hdu:
        hdu = hdu[0]
        try:
            if(hdu.header['CUNIT3']=='M/S' or hdu.header['CUNIT3']=='m/S'):
                hdu.header['CUNIT3'] = 'm/s'
        except KeyError:
            hdu.header['CUNIT3'] = 'm/s'
        try:
            hdu.header['RESTFREQ'] = hdu.header['FREQ0']
        except:
            pass
        bunit = hdu.header['BUNIT']
        spec = hdu.header['CUNIT3']
    toplevel_spectrum_cube = SpectralCube.read(params['cube'])

    fig_spec, ax_spec = plt.subplots(constrained_layout=True)
    ax_spec.axhline(0, color='lightgray')
    ax_spec.plot(toplevel_spectrum_cube.spectral_axis, toplevel_spectrum_cube[:,y,x])

    if(params_display['range_spec']==0):
        ax_spec.set_ylim(params_display['min_cube'],params_display['max_cube'])

    ax_spec.set_xlabel(spec)
    ax_spec.set_ylabel(bunit)
    canvas_spec = FigureCanvasTkAgg(fig_spec, master=toplevel_spectrum)
    canvas_spec.draw()
    canvas_spec.get_tk_widget().pack(side=TOP, fill=BOTH, expand=True)

    plt.close(fig_spec)

