def diminish(dicname, map, dimtodims):
    hdu = fits.open(map)[0]
    if 'CUNIT3' in hdu.header:
        if(hdu.header['CUNIT3']=='PAR'):
            hdu.header['CUNIT3']='m/s'
    hdrtodeletes = np.array(['CDELT','CROTA','CRVAL','CTYPE','CUNIT', 'CRPIX', 'NAXIS'])
    for dimtodim in dimtodims:
        for hdrtodelete in hdrtodeletes:
            hdr2 = hdrtodelete+dimtodim
            hdu.header[hdr2]='bla'
            hdu.header.remove(hdr2)
        hdu.data = np.squeeze(hdu.data, axis=(0))
        hdu.header['NAXIS'] = hdu.header['NAXIS'] - 1

    namesplit_map = os.path.splitext(map)
    newname_map = namesplit_map[0]+"_dim"+namesplit_map[1]

    hdu.writeto(newname_map, overwrite=True)
    map = newname_map
    params[dicname] = map
    return

def browse_cube():
    cube = filedialog.askopenfilename(filetypes=[('FITS files','.fits .FITS')])

    if(len(cube)==0): return
    else: params['cube']=cube

    try:
        hdu = fits.open(cube)[0]
    except OSError:
        hdu = fits.open(cube, ignore_missing_end=True)[0]
        fits.writeto(cube, hdu.data, hdu.header, overwrite=True)
        hdu = fits.open(cube)[0]

    hdr = hdu.header
    data = hdu.data

    if(('CUNIT3' in hdr)==False):
        ys = messagebox.askyesno('Notice', "Cube doesn't seem to contain CUNIT3 information. \n Default as m/s?")
        if(ys):
            with fits.open(cube, 'update') as hdu:
                hdu = hdu[0]
                hdu.header['CUNIT3'] = 'm/s'
        else:
            messagebox.showerror("Error!", "Cube should have CUNIT3 information")
            return

    if(hdr['CUNIT3']=='Hz' or hdr['CTYPE3']=='FREQ'):
        ys = messagebox.askyesno("Convert spectral axis?", "The spectral axis of a input cube should be velocity. Do you want to convert?")
        if ys:
            hdu = fits.open(cube)[0]
            hdr = hdu.header
            try: RESTFRQ = hdr['RESTFRQ']
            except: RESTFRQ = hdr['FREQ0']

            def shift(CRPIX, CRVAL, CDELT, NAXIS):
                CRPIX_new = NAXIS//2
                CRVAL_new = ((CRPIX_new - CRPIX)*CDELT) + CRVAL
                return CRPIX_new, CRVAL_new

            hdr['CRPIX1'], hdr['CRVAL1'] = shift(hdr['CRPIX1'], hdr['CRVAL1'], hdr['CDELT1'], hdr['NAXIS1'])
            hdr['CRPIX2'], hdr['CRVAL2'] = shift(hdr['CRPIX2'], hdr['CRVAL2'], hdr['CDELT2'], hdr['NAXIS2'])
            hdr['CRPIX3'], hdr['CRVAL3'] = shift(hdr['CRPIX3'], hdr['CRVAL3'], hdr['CDELT3'], hdr['NAXIS3'])

            cube_interm = os.path.splitext(cube)[0] + "_interm" + os.path.splitext(cube)[1]
            hdu.writeto(cube_interm, overwrite=True)

            cube_interm = SpectralCube.read(cube_interm)
            cube_vel = cube_interm.with_spectral_unit(u.m/u.s, velocity_convention='optical', rest_value=RESTFRQ*u.Hz)
            cube_vel.write(os.path.splitext(cube)[0]+"_vel"+os.path.splitext(cube)[1], overwrite=True)
            os.remove(os.path.splitext(cube)[0] + "_interm" + os.path.splitext(cube)[1])
            cube = os.path.splitext(cube)[0]+"_vel"+os.path.splitext(cube)[1]
            with fits.open(cube, 'update') as hdu:
                hdu = hdu[0]
                hdu.header['CTYPE3'] = 'VELO-HEL'

            if(fits.getheader(cube)[0]['BUNIT']=='beam-1 Jy'):
                with fits.open(cube, 'update') as hdu:
                    hdu = hdu[0]
                    hdu.header['BUNIT'] = 'JY/BEAM'

            if(fits.getheader(cube)['CUNIT3']=='m s-1'):
                with fits.open(cube, 'update') as hdu:
                    hdu = hdu[0]
                    hdu.header['CUNIT3'] = 'M/S'
            
            params['cube'] = cube
            print('[BAYGAUD] Velocity conversion complete')
        
        else: 
            messagebox.showerror("Error!", "The spectral axis of a cube should be velocity")
            return
    if(len(data.shape)!=3):
        if(len(data.shape)==4):
            ys = messagebox.askyesno("Diminish?", "BAYGAUD input cube should only have RA, DEC and Spectral axis as its dimension. Do you want to diminish the cube?")
            if ys:
                print('[BAYGAUD] Diminishing cube')
                diminish('cube', params['cube'], np.array(['4']))
                print('[BAYGAUD] Cube successfully diminished')
                
    fillentry(entry_cube, params['cube'])
    entry_cube.xview("end")

    params_display['min_cube'] = np.nanmin(data)
    params_display['max_cube'] = np.nanmax(data)

    if(params['main_baygaud']!=''):
        fillentry(entry_main_baygaud, params['main_baygaud'])

    cubehdu = fits.open(cube)[0]
    global naxis1, naxis2
    naxis1 = cubehdu.header['NAXIS1']
    naxis2 = cubehdu.header['NAXIS2']
    fillentry(entry_nax1, naxis1)
    fillentry(entry_nax2, naxis2)
    fillentry(entry_seg_NAXIS1, naxis1)
    fillentry(entry_seg_NAXIS2, naxis2)
    fillentry(entry_total_segs, 1)
    pix_per_seg = int(naxis1*naxis2)
    fillentry(entry_pix_per_seg, pix_per_seg)
    fillentry(entry_nax1_s0, 0)
    fillentry(entry_nax1_e0, naxis1-1)
    fillentry(entry_nax2_s0, 0)
    fillentry(entry_nax2_e0, naxis2-1)
    fillentry(entry_ncolm_per_core, naxis1)
    fillentry(entry_nsegments_nax2, 1)
    textvar_ifleft.set("There is NO leftover part")
    label_ifleft.config(fg='green')

    params['wdir']=cube.split("/"+str(cube.split("/")[-1]))[0]

    if(os.path.exists(params['wdir']+"/segs_scripts")==True):
        ys = messagebox.askyesno("", "Previously made segments detected; Do you want to resume running them?")
        if ys:
            file = "{}/segs_scripts/segs_scripts.txt".format(params['wdir'])
            if(len(file)==0):
                return
            f = open(file, 'r')
            lines = f.readlines()
            words = lines[0].split(" ")
            params['ref_vf'] = words[4]+"/"+words[6]
            resume()
            return
        else:
            global ifresume
            ifresume = 0

    ifvelfits = glob.glob(os.path.splitext(cube)[0]+".*.fits")
    if(len(ifvelfits)==0):
        wdir = params['wdir']
        ifvelfits = glob.glob(wdir+"/*MOM1*FITS") + glob.glob(wdir+"/*MOM1*fits")
        if(len(ifvelfits)==0):
            ifvelfits = glob.glob(wdir+"/*mom1*FITS") + glob.glob(wdir+"/*mom1*fits")
            if(len(ifvelfits)==0):
                return
    ys = messagebox.askyesno("","Do you want to set \n %s \n as ref_vf?"%(ifvelfits[0]))
    if ys:
        global ref_vf
        ref_vf = ifvelfits[0]
        params['ref_vf'] = ref_vf
        hdu = fits.open(ref_vf)[0]

        if(len(hdu.data.shape)>2):
            dimys = messagebox.askyesno("Diminish?", "BAYGAUD input velocity map should only have RA and DEC as its dimension. Do you want to diminish the map?")
            if dimys:
                if(len(hdu.data.shape)==4):
                    print("[BAYGAUD] Diminishing velocity map")
                    diminish('ref_vf', params['ref_vf'], np.array(['4','3']))
                    print("[BAYGAUD] Velocity map successfully diminished")
                elif(len(hdu.data.shape)==3):
                    print("[BAYGAUD] Diminishing velocity map")
                    diminish('ref_vf', params['ref_vf'], np.array(['3']))
                    print("[BAYGAUD] Velocity map successfully diminished")


        fillentry(entry_ref_vf, params['ref_vf'])
        entry_ref_vf.xview("end")
                
        initdisplay()

    
