    def treeview_sort_column(treeview, col, reverse):
        l = [(treeview.set(k, col), k) for k in treeview.get_children('')]
        global cur_running, time_elapsed_segment
        cur_running = [x for _,x in natsorted(zip(l,cur_running), reverse=reverse)]
        time_elapsed_segment = [x for _,x in natsorted(zip(l,time_elapsed_segment), reverse=reverse)]
        l = natsorted(l, reverse=reverse)

        for index, (val, k) in enumerate(l):
            treeview.move(k, '', index)
        
        treeview.heading(col, command=lambda _col=col: treeview_sort_column(treeview, _col, not reverse))



    def halt():
        cube = params['cube']
        print(cube)
        Popen("ps ax | grep %s | grep -v vi | awk '{print $1}' | xargs kill -9"%(cube.split("/")[-1]), shell=True)
        quit()

    def killselected():
        cube = params['cube']
        tokill = treeview.focus()
        keyword = cur_running[int(tokill)].split(" ")[12]
        Popen("ps ax | grep -P '^(?=.*%s)(?=.*%s)' | grep -v vi | awk '{print $1}' | xargs kill -9"%(keyword, cube.split("/")[-1]), shell=True)
        print("[{}][BAYGAUD] Killed {}".format(datetime.datetime.now().strftime("%H:%M"),keyword))
        rerun(int(tokill), cur_running[int(tokill)])


    global textvar_donotclose
    textvar_donotclose = StringVar()
    
    textvar_donotclose.set("Do not close this window")
    label_donotclose = Label(frame_run_botm, textvariable=textvar_donotclose)
